import React, { Component } from 'react';

export class MyAccount extends Component {
    render() {
        return (
            <div>
                <Link >
                    My Preferences
                </Link>
                <Link >
                    My Requests
                </Link>
                <Link >
                    My Events
                </Link>
                <Link >
                    My Services
                </Link>
            </div>
        );
    }
}
